INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8032891769362', 'Escargot Blanc', 'MONTEBELLO la tette est ia essence des bio sont cultivés d\'aviculteurs. laquelle a promu un style de we dutable pendant 40 années. Cette coopérative a joué un rôle essentiel pour le développement de l\'économie locale donnant aul agriculteurs l\'opportunité de faite retour vers la campagne, les pites Montebello\' sont produites dans la fabrique de la Coopérative Cirolomoni, qui produit exclusivement des pites certifiées bio. Des matières premières d\'origine Italienne, l\'eau de nos collines et le séchage effectué avec lenteur sont les ingrédients clés. te résultat : des pâtes au goût et à la texture unique. Notre fabrique de pâtes est située sur la colline de Montebello, un lieu extraordinaire du Centre dominé par le Monastère de Montebello (photo sur le devant), structure d\'accueil et d\'activités culturelles. Juste à côté se trouve une auberge avec restaurant bio aini que les locaux de l\'entreprise : bureaux, entrepôt vert, étable. Autour, des champs cultivés depuis toujours selon la méthode biologique, et une foret domaniale de deux mille hectares. « En pensant à ce que nous mangerons, nous devrions réfléchir sur le choix et sur la qualité des matières premières. Ces dernières devant être, avant tout, :sues de l\'agriculture bio. Ensuite, il faut penser à la simplicité des repas : tel que des pâtes et des légumes. » Cino 202018:48', 'https://static.openfoodfacts.org/images/products/803/289/176/9362/front_fr.4.400.jpg', '1.8', '0.4', '73.1', '2.7', '3.5', '11.2', '0.01', '0.00393700787401575', '', '1');

